import React from "react";
import "./Slider.css";
import Probe from "../../assets/complete_probe.png";

const Slider = () => {
  return (
    <>
      <div id="slide-window">
        <ol id="slides" start={1}>
        <li
            className="slide color-0 alive"
            // style={{
            //   "background-image":
            //     "url(http://stuckincustoms.smugmug.com/Portfolio/i-JSxf5Nm/0/X3/Burning-Man-Day-6%20%28202%20of%201606%29-X3.jpg)",
            // }}
          >
            <img />
          </li>
          <li
            className="slide color-0 alive"
            style={{
              "background-image":
                "url(http://stuckincustoms.smugmug.com/Portfolio/i-JSxf5Nm/0/X3/Burning-Man-Day-6%20%28202%20of%201606%29-X3.jpg)",
            }}
          />
          <li
            className="slide color-1"
            style={{
              "background-image":
                "url(http://stuckincustoms.smugmug.com/Portfolio/i-KMjVHRd/0/X3/Andramada-X3.jpg)",
            }}
          />
          <li
            className="slide color-2"
            style={{
              "background-image":
                "url(http://stuckincustoms.smugmug.com/Burning-Man/i-dd9xmfn/0/X3/The%20Steamy%20Car-X3.jpg)",
            }}
          />
          <li
            className="slide color-3"
            style={{
              "background-image":
                "url(http://stuckincustoms.smugmug.com/Portfolio/i-KscS8CF/0/X3/Burning-Man-Day-1%20%281006%20of%201210%29-X3.jpg)",
            }}
          />
          <li
            className="slide color-4"
            style={{
              "background-image":
                "url(http://stuckincustoms.smugmug.com/Portfolio/i-jQcPqJb/0/X3/Burning-Man-Last-Day-Night%20%28151%20of%201120%29-X3.jpg)",
            }}
          />
        </ol>
        <span className="nav fa fa-chevron-left fa-3x" id="left" />
        <span className="nav fa fa-chevron-right fa-3x" id="right" />
        {/* <div id="credit">Photography by Trey Ratcliff<br />Slide No.<span id="count">1</span><br /><span id="zoom">zoom</span></div> */}
      </div>
    </>
  );
};

export default Slider;
